/**
 * Definition for singly-linked list.
 * public class ListNode {
 *     int val;
 *     ListNode next;
 *     ListNode() {}
 *     ListNode(int val) { this.val = val; }
 *     ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */
class Solution {
    public ListNode swapPairs(ListNode head) {
        if(head == null || head.next == null) return head;
        ListNode dummyHead = new ListNode();
        dummyHead.next = head;
        ListNode curr = dummyHead;
        while(curr.next != null && curr.next.next != null){
            ListNode first = curr.next, second = curr.next.next;
            first.next = second.next;
            second.next = first;
            curr.next = second;
            curr = first;
        }
        return dummyHead.next;
    }
}

Conclusion
Key: Find three important nodes: curr, first,  and second

Process the edge
Create a dummyHead node, use while loop to make sure first and second is not null
Reassign the relationship between them
Loop until the end

